    class Program
    {
        static void Main(string[] args)
        {
            Container.Init();//初始化Ioc容器
            string TokenUrl = ConfigurationManager.AppSettings["TokenUrl"].ToString();
            string CreateUserUrl = ConfigurationManager.AppSettings["CreateUserUrl"].ToString();
            string LoginId = ConfigurationManager.AppSettings["LoginId"].ToString();
            string LoginPsd = ConfigurationManager.AppSettings["LoginPsd"].ToString();

            //
            IAuthorityService AuthorityService = Container.Instance.Resolve<IAuthorityService>();
            IStaffManagementService StaffManagementService = Container.Instance.Resolve<IStaffManagementService>();
            //获取Token
            string Token = AuthorityService.GetToken(TokenUrl, LoginId,LoginPsd);

            List<v_smartpark_emp> lst = GetData();
            foreach (v_smartpark_emp item in lst)
            {
                Dictionary<string, string> dic = new Dictionary<string, string>();
                dic.Add("subject_type", "0");
                dic.Add("group_ids", "0");
                dic.Add("extra_id", item.EmpNumber);
                dic.Add("name", item.EmpName);

                Stream stream = new MemoryStream(item.FileData);
                Bitmap img = new Bitmap(stream);
                img.Save(AppDomain.CurrentDomain.BaseDirectory + $@"\Photo\{item.EmpName}.jpg");
                string filepath = AppDomain.CurrentDomain.BaseDirectory + $@"\Photo\{item.EmpName}.jpg";
                string ResponseResult = StaffManagementService.PostCreateUpLoadUser(CreateUserUrl, Token, 30000, "photo", filepath, dic);
            }


