            //string ResponseResult = StaffManagementService.PostCreateUpLoadUser(CreateUserUrl, Token, 30000, "photo", filepath, dic);

        }


        public static List<v_smartpark_emp> GetData()
        {
            try
            {
                List<v_smartpark_emp> MainList = null;
                StringBuilder sb = new StringBuilder();
                sb.Append(@"select  EmpNumber,EmpName,JDate,FileData from v_smartpark_emp
                            where EmpName = '余红林'");
                using (var db = new DBContext ())
                {
                    return MainList = db.Database.SqlQuery<v_smartpark_emp>(sb.ToString()).ToList();//
                }

            }
            catch (Exception ex)
            {
                return null;
            }
        }

    }
